pragma solidity 0.4.18;

import "zeppelin-solidity/contracts/math/SafeMath.sol";
import "NonFungibleToken/contracts/NonFungibleToken.sol";
import "zeppelin-solidity/contracts/ownership/Ownable.sol";


contract Tranche is NonFungibleToken, Ownable  {
    using SafeMath for uint;

    uint public trancheLimit;
    uint public trancheValue;
    uint public totalPayout;

    string public name  = "TrancheToken";
    string public symbol = "TRTK";

    //_tokenId to value
    mapping (uint => uint) public tokenPayouts;

    //set up so you create each tranche
    function Tranche(uint _trancheLimit, uint _trancheValue) public {
        //limit on the number of tranche's allowed 
        trancheLimit = _trancheLimit;
        //limit on the tranche value
        trancheValue = _trancheValue;
        totalPayout = 0;
        uint i;
        for(i = 0; i < _trancheLimit; i++){
            _setTokenOwner(i, msg.sender);
            _addTokenToOwnersList(msg.sender, i);

            numTokensTotal = numTokensTotal.add(1);
        }

    }

    function currentPayout(uint _tokenId) public view returns (uint){
        return tokenPayouts[_tokenId];
    }

    function expectedPayoutTotal() public view returns(uint){
        return trancheLimit.mul(trancheValue);
    }

    //takes a target value, matches it, returns the amount added to match that value
    function matchPayout(uint _tokenId, uint _totalToMatch) public onlyOwner requireFullTranche requireNotPayedInFull(_tokenId) returns (uint) { 
        require(_totalToMatch <= trancheValue);
        uint _addVal = _totalToMatch.sub(tokenPayouts[_tokenId]);
        tokenPayouts[_tokenId] = _totalToMatch;
        totalPayout = totalPayout.add(_addVal);
        return _addVal;
    }

    modifier requireNotPayedInFull(uint _tokenId) { 
        require(tokenPayouts[_tokenId] < trancheValue);
        _; 
    }


    modifier requireFullTranche() { 
        require(totalSupply() == trancheLimit); 
        _; 
    }


    modifier limitTrancheSupply() { 
        require(totalSupply() <= trancheLimit); 
        _; 
    }


}
